  "description": {
    "nb": "Besøkstal for datahotellet (hotell.difi.no) som viser sidevisninger pr. datasett, og for kvart datasett kor mange sidevisningar som er av ulike format (JSON, JSONP, XML, komplett nedlasting m.m.). I tillegg er eit omtrentleg tal for trafikk (i bytes) pr. datasett.Kjelde for data er data om sidevisningar i AWStats. Desse tala er køyrt gjennom eit program som summerer opp trafikk pr. datasett og filtrerer ut urelevant trafikk.For forklaring på dei ulike felta, derunder mulege verdiar, sjå feltdefinisjoner.OBS. Merk at statistikk før 2017 er feil. Dette skuldast tekniske problem som gjer at vi manglar trafikkdata for større eller mindre periodar. For eksempel manglar eitt av åra data for over 100 dagar.Idear til bruk- Lage ein webapp som viser statistikk pr. datasett, graf for sidevisningar over tid.- Summere opp trafikk pr. datautgjevarDet kan vere feil i datasettet. Bruk kommentarfeltet dersom du har spørsmål, innspel eller andre kommentarar!"
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eBesøkstal for datahotellet (hotell.difi.no) som viser sidevisninger pr. datasett, og for kvart datasett kor mange sidevisningar som er av ulike format (JSON, JSONP, XML, komplett nedlasting m.m.). I tillegg er eit omtrentleg tal for trafikk (i bytes) pr. datasett.\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eKjelde\u003c/strong\u003e for data er data om sidevisningar i AWStats. Desse tala er køyrt gjennom eit program som summerer opp trafikk pr. datasett og filtrerer ut urelevant trafikk.\u003c/p\u003e\u003cp\u003eFor \u003cstrong\u003eforklaring\u003c/strong\u003e på dei ulike felta, derunder mulege verdiar, sjå feltdefinisjoner.\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eOBS\u003c/strong\u003e. Merk at statistikk før 2017 er feil. Dette skuldast tekniske problem som gjer at vi manglar trafikkdata for større eller mindre periodar. For eksempel manglar eitt av åra data for over 100 dagar.\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eIdear til bruk\u003c/strong\u003e\u003cbr\u003e- Lage ein webapp som viser statistikk pr. datasett, graf for sidevisningar over tid.\u003cbr\u003e- Summere opp trafikk pr. datautgjevar\u003c/p\u003e\u003cp\u003eDet kan vere feil i datasettet. Bruk kommentarfeltet dersom du har spørsmål, innspel eller andre kommentarar!\u003c/p\u003e"
