    "nb": "I denne søketjenesten kan du hente informasjon om gyldige vitenskapelige navn etter gjeldende internasjonale standarder (International Code of Botanical Nomenclature, International Code of Zoological Nomenclature), synonymer og anbefalte norske navn på bokmål og nynorsk. Du kan også se hvor i det hierarkiske slektskapstreet arten eller gruppen hører hjemme.Søketjenesten gir i dag ikke en komplett oversikt over alle vitenskapelige og norske navn på arter og organismegrupper. Av hovedgrupper som delvis mangler er for eksempel protozoer, flere sopp-ordener, midd, nesledyr, bakterier og virus. Det systematiske hierarkiet ned til ordensnivå er i utgangspunktet hentet fra Catalogue of Life. Det er et mål at tjenesten på sikt skal inneholde navn på alle kjente arter i Norge og arter i nærliggende geografiske områder som over tid kan forventes å finnes i Norge. Databasen inneholder også navn på mange arter som ikke finnes i Norge. Per i dag er det ikke synlig i innsynsløsningen hvilke navn som kun gjelder arter som finnes i Norge, men slik informasjon kan hentes ut ved å eksportere datalister eller søke på artsportalen. Det jobbes kontinuerlig for å importere et større tilfang av synonyme navn (vitenskapelige og norske). Databasen inneholder et stort referansemateriale til litteratur for navn og navneendringer som ikke vises i dag, men som vil bli gjort tilgjengelig i en senere versjon av databasen.Navnebasen driftes av Artsdatabanken i samarbeid med GBIF-Norge. Navnene er samlet inn, kvalitetssikret og tilrettelagt av en rekke navnekomiteer fra vitenskapelige institusjoner i Norge. Som en overbygning for komiteene er det etablert et navneråd for å sikre en enhetlig gjennomføring av det faglige arbeidet. Navnekomiteene har også en god rådgivende støtte i Språkrådet i arbeidet med norske navn."
  },
