  "title": {
    "nb": "Nasjonale faglige retningslinjer, veiledere og pakkeforløp"
  },
  "description": {
    "nb": "Helsedirektoratet har fra 2012 et lovfestet mandat til å utvikle, formidle og vedlikeholde nasjonale faglige retningslinjer og veiledere som understøtter de mål som er satt for helse- og omsorgstjenesten. Retningslinjer og veiledere skal baseres på kunnskap om god praksis og skal bidra til kontinuerlig forbedring av virksomhet og tjenester (Helse- og omsorgstjenesteloven § 12-5 og Spesialisthelsetjenesteloven § 7-3)En nasjonal faglig retningslinje inneholder systematisk utviklede faglige anbefalinger som etablerer en nasjonal standard for utredning, behandling og oppfølgning av pasientgrupper, brukergrupper eller diagnosegrupper. Helsedirektoratet er ikke, og skal ikke være, heldekkende med sine nasjonale faglige retningslinjer. I utvelgelsen av fagområder og spørsmål som omhandles i nasjonale faglige retningslinjer prioriteres områder der man ser behov for å sikre god kvalitet, riktige prioriteringer og til å hindre uønsket variasjon i helsetjenestene, løse samhandlingsutfordringer og sikre helhetlige pasientforløp.Helsedirektoratet tilgjengeliggjør nå innholdet i nasjonale faglige retningslinjer, veiledere og pakkeforløp via data.helsedirektoratet.no. Datasettet inkluderer konkrete anbefalinger innenfor utvalgte kliniske områder og inkluderer nødvendig bakgrunnsinformasjon og begrunnelser, samt knytning av innholdet med relevante kliniske koder fra standardiserte kodeverk (f.eks. ICD-10, ICPC-2, ATC, MESH). Datasettet kan benyttes til å publisere innholdet fra nasjonale faglige retningslinjer, veiledere og pakkeforløp i ulike kanaler, f.eks. på nettsider, i mobile applikasjoner, og i ulike IT-systemer som benyttes av klinikere (f.eks. elektronisk pasientjournal, elektronisk kurve og kvalitetssystemer). Datasettet er tilgjengelig i JSON-format."
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eHelsedirektoratet har fra 2012 et lovfestet mandat til å utvikle, formidle og vedlikeholde nasjonale faglige retningslinjer og veiledere som understøtter de mål som er satt for helse- og omsorgstjenesten. Retningslinjer og veiledere skal baseres på kunnskap om god praksis og skal bidra til kontinuerlig forbedring av virksomhet og tjenester (Helse- og omsorgstjenesteloven § 12-5 og Spesialisthelsetjenesteloven § 7-3)\u003c/p\u003e\u003cp\u003eEn nasjonal faglig retningslinje inneholder systematisk utviklede faglige anbefalinger som etablerer en nasjonal standard for utredning, behandling og oppfølgning av pasientgrupper, brukergrupper eller diagnosegrupper. Helsedirektoratet er ikke, og skal ikke være, heldekkende med sine nasjonale faglige retningslinjer. I utvelgelsen av fagområder og spørsmål som omhandles i nasjonale faglige retningslinjer prioriteres områder der man ser behov for å sikre god kvalitet, riktige prioriteringer og til å hindre uønsket variasjon i helsetjenestene, løse samhandlingsutfordringer og sikre helhetlige pasientforløp.\u003c/p\u003e\u003cp\u003eHelsedirektoratet tilgjengeliggjør nå innholdet i nasjonale faglige retningslinjer, veiledere og pakkeforløp via data.helsedirektoratet.no. Datasettet inkluderer konkrete anbefalinger innenfor utvalgte kliniske områder og inkluderer nødvendig bakgrunnsinformasjon og begrunnelser, samt knytning av innholdet med relevante kliniske koder fra standardiserte kodeverk (f.eks. ICD-10, ICPC-2, ATC, MESH). Datasettet kan benyttes til å publisere innholdet fra nasjonale faglige retningslinjer, veiledere og pakkeforløp i ulike kanaler, f.eks. på nettsider, i mobile applikasjoner, og i ulike IT-systemer som benyttes av klinikere (f.eks. elektronisk pasientjournal, elektronisk kurve og kvalitetssystemer). Datasettet er tilgjengelig i JSON-format.\u003c/p\u003e"
