  "title": {
    "nb": "FEST (Forskrivnings- og ekspedisjonsstøtte)"
  },
  "description": {
    "nb": "Legemiddelverket forvalter strukturert informasjon om legemidler gjennom FEST (forskrivnings- og ekspedisjonsstøtte). FEST er et datagrunnlag og den primære kilden til informasjon om legemidler og refusjonsinformasjon i legenes journalsystem, apotekenes ekspedisjonssystem, e-resept, kjernejournal mv. Det er både legemiddelinformasjon fra eget forvaltingsområde og fra aktuelle samarbeidspartnere. FEST er et datagrunnlag der informasjonen blir presentert i XML-format og forutsetter at du har et program som kan settes opp til å laste ned FEST-meldingen (M30). Via FEST kan Legemiddelverket sende varsler med viktig informasjon direkte til legens journalsystem, for eksempel informasjon om alvorlige bivirkninger, tilbaketrekkinger og legemiddelinteraksjoner mv.Legemiddelverket arbeider for at FEST skal gå fra å leveres på XML-format til å presenteres som åpne, lenkede data. Stadig nye grupper tar i bruk FEST, som for eksempel sykehus og sykehjem. Dette krever en pålitelig, fleksibel og tilgjengelig FEST-tjeneste. FEST er, slik den er bygd opp i dag, ikke egnet for å møte de kommende behovene. Det er behov for å utvikle FEST til en åpen datakilde. Dette innebærer at informasjonen gjøres så tilgjengelig som mulig og at data presenteres på en måte som tillater direkte spørring."
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eLegemiddelverket forvalter strukturert informasjon om legemidler gjennom FEST (forskrivnings- og ekspedisjonsstøtte). FEST er et datagrunnlag og den primære kilden til informasjon om legemidler og refusjonsinformasjon i legenes journalsystem, apotekenes ekspedisjonssystem, e-resept, kjernejournal mv. Det er både legemiddelinformasjon fra eget forvaltingsområde og fra aktuelle samarbeidspartnere. FEST er et datagrunnlag der informasjonen blir presentert i XML-format og forutsetter at du har et program som kan settes opp til å laste ned FEST-meldingen (M30). Via FEST kan Legemiddelverket sende varsler med viktig informasjon direkte til legens journalsystem, for eksempel informasjon om alvorlige bivirkninger, tilbaketrekkinger og legemiddelinteraksjoner mv.\u003c/p\u003e\u003cp\u003eLegemiddelverket arbeider for at FEST skal gå fra å leveres på XML-format til å presenteres som åpne, lenkede data. Stadig nye grupper tar i bruk FEST, som for eksempel sykehus og sykehjem. Dette krever en pålitelig, fleksibel og tilgjengelig FEST-tjeneste. FEST er, slik den er bygd opp i dag, ikke egnet for å møte de kommende behovene. Det er behov for å utvikle FEST til en åpen datakilde. Dette innebærer at informasjonen gjøres så tilgjengelig som mulig og at data presenteres på en måte som tillater direkte spørring.\u003c/p\u003e"
  },
