  "title": {
    "nb": "Nasjonal database for tur- og friluftsruter"
  },
  "description": {
    "nb": "I databasen er det registrert objekter av typen fotrute, skiløype, sykkelrute, annen rute (samlebetegnelse for andre ruter som for eksempel padlerute eller riderute) og tilretteleggingspunkter for friluftsliv. Ruter består av skiltede/merkede ruter eller stier og materuter som har en funksjon for en rute. Alle ruter som er merket/skiltet og kartlagt med offentlige midler skal være registrert i tillegg til sti- og løypeplaner fra kommuner eller andre som har ansvar for slike planer. Det er ikke registrert turforslag i databasen.Nasjonal database for tur- og friluftsruter skal spesielt sikre god forvaltning av friluftsområder og sikre at redningsetater kommer raskt frem om uhellet er ute. Databasen skal dekke behov knyttet til kommunenes rapportering og søknad om spillemidler fra Kulturdepartementet, der en må rapportere på skjøtselsinformasjon knyttet til stier og løyper. Dataene blir viktig basisinformasjon i arbeidet med kartlegging og verdsetting av friluftslivsområder, samt i arbeidet med kommunale sti- og løypeplaner. Dataene er viktig informasjon i planarbeid generelt, og dataene vil ikke minst også være svært relevant informasjon til publikum. Dataformatet er SOSI"
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eI databasen er det registrert objekter av typen fotrute, skiløype, sykkelrute, annen rute (samlebetegnelse for andre ruter som for eksempel padlerute eller riderute) og tilretteleggingspunkter for friluftsliv. Ruter består av skiltede/merkede ruter eller stier og materuter som har en funksjon for en rute. Alle ruter som er merket/skiltet og kartlagt med offentlige midler skal være registrert i tillegg til sti- og løypeplaner fra kommuner eller andre som har ansvar for slike planer. Det er ikke registrert turforslag i databasen.\u003c/p\u003e\u003cp\u003eNasjonal database for tur- og friluftsruter skal spesielt sikre god forvaltning av friluftsområder og sikre at redningsetater kommer raskt frem om uhellet er ute. Databasen skal dekke behov knyttet til kommunenes rapportering og søknad om spillemidler fra Kulturdepartementet, der en må rapportere på skjøtselsinformasjon knyttet til stier og løyper. Dataene blir viktig basisinformasjon i arbeidet med kartlegging og verdsetting av friluftslivsområder, samt i arbeidet med kommunale sti- og løypeplaner. Dataene er viktig informasjon i planarbeid generelt, og dataene vil ikke minst også være svært relevant informasjon til publikum. Dataformatet er SOSI\u003c/p\u003e"
