  },
  "description": {
    "nb": "Statistikken gir oversikt over resultater på Statsborgerprøven. For å få statsborgerskap er det fra 1. januar 2017 krav om norskkunnskaper og bestått prøve i samfunnskunnskap på norsk. Kravet om bestått prøve i samfunnskunnskap kan blant annet oppfylles med bestått statsborgerprøve.TabellerResultater på Statsborgerprøven per kommune og fylkeSammenlikne resultaterLag for eksempel en tabell med resultater fra utvalgte kommuner, fylker og hele landet. Gå til ønsket variabel ved å klikke deg inn på feltet over tabellen og videre til «Endre utvalg». I menylinja kan du velge om du vil hente frem forklaring eller kilde, se statistikken som diagrammer, eksportere dataene til Excel eller pdf og kopiere lenken til den spesifikke visningen av en tabell eller et diagram. Se hvor du gjør det på vår hjelpeside."
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eStatistikken gir oversikt over resultater på Statsborgerprøven. For å få statsborgerskap er det fra 1. januar 2017 krav om norskkunnskaper og bestått prøve i samfunnskunnskap på norsk. Kravet om bestått prøve i samfunnskunnskap kan blant annet oppfylles med bestått statsborgerprøve.\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eTabeller\u003c/strong\u003e\u003c/p\u003e\u003cp\u003e\u003ca href\u003d\"http://status.vox.no/webview/index.jsp?headers\u003dvirtual\u0026amp;virtualsubset\u003dAntall_value+-+Ikkebestatt_value\u0026amp;v\u003d2\u0026amp;stubs\u003dSted\u0026amp;measure\u003dcommon\u0026amp;Stedsubset\u003d23%2C1+-+24\u0026amp;measuretype\u003d4\u0026amp;study\u003dhttp%3A%2F%2F10.36.88.50%3A80%2Fobj%2FfStudy%2Fstatsborgerprove-resultater-fylkekommune\u0026amp;language\u003dno\u0026amp;cube\u003dhttp%3A%2F%2Fstatus.dmzvox.local%3A80%2Fobj%2FfCube%2Fstatsborgerprove-resultater-fylkekommune_C1\u0026amp;mode\u003dcube\u0026amp;top\u003dyes\" rel\u003d\"nofollow\"\u003eResultater på Statsborgerprøven per kommune og fylke\u003c/a\u003e\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eSammenlikne resultater\u003c/strong\u003e\u003cbr\u003eLag for eksempel en tabell med resultater fra utvalgte kommuner, fylker og hele landet. Gå til ønsket variabel ved å klikke deg inn på feltet over tabellen og videre til «Endre utvalg». I menylinja kan du velge om du vil hente frem forklaring eller kilde, se statistikken som diagrammer, eksportere dataene til Excel eller pdf og kopiere lenken til den spesifikke visningen av en tabell eller et diagram. Se hvor du gjør det på vår \u003ca href\u003d\"http://www.vox.no/contentassets/3ad9ac236d1a4dfd82e607439580002a/hjelpeside_statistikkbank.png\" rel\u003d\"nofollow\"\u003ehjelpeside\u003c/a\u003e.\u003c/p\u003e"
