  "title": {
    "nb": "Fangstdata koblet med fartøydata"
  },
  "description": {
    "nb": "Datasettet er eit samensett datasett som inneheld fangstdata frå Fiskeridirektoratets landings- og sluttseddelregister og fartøydata frå Fiskeridirektoratets merkeregister. Datasettet inkluderer all fangst av norske fartøy og fangst av utanlandske fartøy som er landa i Norge. Tidsserien startar på år 2000. Datasettet inneheld driftsdata. Driftsdata gjennomgår same kvalitetssikring som data for offisiell statistikk. Medan data for offisiell statistikk på eit tidspunkt vert låst for vidare endringar vil driftsdata «leve» vidare og fortsatt kunne oppdaterast og verte endra. Driftsdata vil i hovudsak nyttast til forvaltnings- og kontrollformål.Datasettet inneheld informasjon om all fiske og fangst i sjøen tatt av norskregistrerte fiskefartøy samt fangst av utanlandske fartøy som er landa i Noreg. Datasettet skal også innehalde informasjon om forskingsfangst, skulefangst samt all førstehandsomsetning av fritidsfiske."
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eDatasettet er eit samensett datasett som inneheld fangstdata frå Fiskeridirektoratets landings- og sluttseddelregister og fartøydata frå Fiskeridirektoratets merkeregister. Datasettet inkluderer all fangst av norske fartøy og fangst av utanlandske fartøy som er landa i Norge. Tidsserien startar på år 2000. Datasettet inneheld driftsdata. Driftsdata gjennomgår same kvalitetssikring som data for offisiell statistikk. Medan data for offisiell statistikk på eit tidspunkt vert låst for vidare endringar vil driftsdata «leve» vidare og fortsatt kunne oppdaterast og verte endra. Driftsdata vil i hovudsak nyttast til forvaltnings- og kontrollformål.\u003c/p\u003e\u003cp\u003eDatasettet inneheld informasjon om all fiske og fangst i sjøen tatt av norskregistrerte fiskefartøy samt fangst av utanlandske fartøy som er landa i Noreg. Datasettet skal også innehalde informasjon om forskingsfangst, skulefangst samt all førstehandsomsetning av fritidsfiske.\u003c/p\u003e"
  },
