  },
  "description": {
    "nb": "Brukerminner fra Kulturminnesøk er et datasett (i form av en fildump) som består av publikums egne registreringer i nettløsningen Kulturminnesøk. Kulturminnesøk er en formidlingstjeneste fra Riksantikvaren, og driftes av en redaksjon. Informasjonen om de fleste kulturminnene i Kulturminnesøk kommer fra kulturminnebasen Askeladden som forvaltes av Riksantikvaren, men du som bruker kan altså også bidra med dine brukerminner inn i løsningen. Teknisk informasjonDatasettet følger GeoJSON-LD-standarden. Det kan leses og brukes som vanlig GeoJSON, men har også en semantisk komponent som gjør at det kan prosesseres som JSON-LD. For mer informasjon, se http://geojson.org/geojson-ld/. Hvert dokument kan kobles med kulturminnesøk. F.eks. kan dokumentet med ID http://kulturminnesok.no/fm/gilahytta-1 hentes fra kulturminnesøk slik: https://kulturminnesok.no/minne/?queryString\u003dhttp://kulturminnesok.no/fm/gilahytta-1"
  },
