  "title": {
    "nb": "Visveginfo - komplekse spørringer på vegnett"
  },
  "description": {
    "nb": "Vi utvider stadig API\u0027et for Nasjonal vegdatabank med nye funksjoner og datatyper. Like fullt ser vi at det er en del spesialbehov som krever mer komplekse spørringer på vegnettet.Tjenesten Visveginfo er et REST api for en del mer komplekse spørringer på vegnettet, blant annet med spørringer filtrert på vegnummer og vegkategori, samt historikk, på ulike topologiske nivåer. Vi anbefaler sterkt at interesserte leser seg opp på Håndbok v830 Nasjonalt vegreferansesystem.For mange bruksområder -- for eksempel ruteforslag fra A til B -- så er ruteplantjenesten langt bedre egnet. For konvertering mellom koordinat, vegreferanse og veglenke ID anbefaler vi NVDB api\u0027ets endepunkt posisjon og veg. Visveginfo blir i hovedsak oppdatert en gang i døgnet. Dette avviker både fra NVDB api (fortløpende) og ruteplantjenesten (cirka annehver måned).For nyheter om NVDB, følg oss på twitter.com/NVDBapi. For nyheter, driftsmeldinger og tips om alle data fra Statens vegvesen, følg oss på twitter.com/VegvesenData. "
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eVi utvider stadig \u003ca href\u003d\"https://api.vegdata.no\" rel\u003d\"nofollow\"\u003eAPI\u0027et for Nasjonal vegdatabank\u003c/a\u003e med nye funksjoner og datatyper. Like fullt ser vi at det er en del spesialbehov som krever mer komplekse spørringer på vegnettet.\u003c/p\u003e\u003cp\u003eTjenesten Visveginfo er et REST api for en del mer komplekse spørringer på vegnettet, blant annet med spørringer filtrert på vegnummer og vegkategori, samt historikk, på ulike topologiske nivåer. Vi anbefaler sterkt at interesserte leser seg opp på \u003ca href\u003d\"http://www.vegvesen.no/_attachment/61505\" rel\u003d\"nofollow\"\u003eHåndbok v830 Nasjonalt vegreferansesystem\u003c/a\u003e\u003ca href\u003d\"http://www.vegvesen.no/_attachment/61505/binary/963986?fast_title\u003dH%C3%A5ndbok+V830+Nasjonalt+vegreferansesystem.pdf\" rel\u003d\"nofollow\"\u003e.\u003c/a\u003e\u003c/p\u003e\u003cp\u003eFor mange bruksområder -- for eksempel ruteforslag fra A til B -- så er \u003ca href\u003d\"http://data.norge.no/data/statens-vegvesen/api-ruteplantjeneste-bil\" rel\u003d\"nofollow\"\u003eruteplantjenesten\u003c/a\u003e langt bedre egnet. For konvertering mellom koordinat, vegreferanse og veglenke ID anbefaler vi NVDB api\u0027ets endepunkt \u003ca href\u003d\"https://api.vegdata.no/endepunkt/posisjon.html\" rel\u003d\"nofollow\"\u003eposisjon\u003c/a\u003e og \u003ca href\u003d\"https://api.vegdata.no/endepunkt/veg.html\" rel\u003d\"nofollow\"\u003eveg\u003c/a\u003e. \u003c/p\u003e\u003cp\u003eVisveginfo blir i hovedsak oppdatert en gang i døgnet. Dette avviker både fra NVDB api (fortløpende) og ruteplantjenesten (cirka annehver måned).\u003c/p\u003e\u003cp\u003eFor nyheter om NVDB, følg oss på \u003ca href\u003d\"https://twitter.com/NVDBapi\" rel\u003d\"nofollow\"\u003etwitter.com/NVDBapi\u003c/a\u003e. For nyheter, driftsmeldinger og tips om alle data fra Statens vegvesen, følg oss på \u003ca href\u003d\"https://twitter.com/VegvesenData\" rel\u003d\"n